  `ship_receiptpay_fee` double(10,2) DEFAULT '0.00' COMMENT '回单付',
  `ship_monthpay_fee` double(10,2) DEFAULT '0.00' COMMENT '月付',
  `ship_arrearspay_fee` double(10,2) DEFAULT '0.00' COMMENT '短欠付',
  `ship_goodspay_fee` double(10,2) DEFAULT '0.00' COMMENT '货款付',
  `ship_receipt_status` tinyint(2) DEFAULT '0' COMMENT '回单状态（0：未收回，1：已收回，2：已寄出，3：已接收，4已发放）',
  `ship_receipt_require` tinyint(2) DEFAULT '1' COMMENT '回单要求（1：回单，2：电子回单，3：原单，4：收条，5:信封）',
  `ship_receipt_num` tinyint(3) DEFAULT '0' COMMENT '回单份数',
  `ship_receipt_remark` varchar(100) DEFAULT NULL COMMENT '回单备注',
  `ship_sign_time` datetime DEFAULT NULL COMMENT '签收时间-表明已经签收',
  `ship_total_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '费用合计',
  `ship_rebate_fee` decimal(10,2) DEFAULT '0.00' COMMENT '回扣费',
  `ship_is_rebate` bit(1) DEFAULT b'0' COMMENT '回扣是否返回（0：未返，1：已返）',
  `ship_fee_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '费用结算， 0-未结算(默认)，1-已结算',
  `ship_fee_agency` tinyint(2) DEFAULT '0' COMMENT '是否代收运输费用（0：未代收，1：已代收）',
  `ship_status` tinyint(2) DEFAULT '1' COMMENT '运单状态：1：已入库、2：短驳中、3：短驳到达、4：已发车、5：已到达、6：收货中转中、7：到货中转中、8：送货中、9：已签收；',
  `ship_before_status` tinyint(2) DEFAULT NULL COMMENT '上一个运单状态',
  `ship_deleted` bit(1) DEFAULT b'0' COMMENT '是否删除（0：正常，1：删除）',
  `ship_customer_number` varchar(32) DEFAULT NULL COMMENT '客户单号',
  `ship_delivery_method` tinyint(2) NOT NULL DEFAULT '1' COMMENT '送货方式, 1-送货上门, 2--自提, 3-送货上楼,4-送货卸货',
  `ship_delivered_time` datetime DEFAULT NULL COMMENT '已完成运送时间',
  `ship_agency_fund` double(10,2) DEFAULT '0.00' COMMENT '代收货款',
  `ship_agency_fund_status` tinyint(2) DEFAULT '1' COMMENT '货款状态（1:未回收,2:已回收,3:已汇款,4:已到账,5:已发放）',
  `load_network_id` int(11) DEFAULT NULL COMMENT '所属配载网点',
  `before_load_network_id` int(11) DEFAULT NULL COMMENT '前一个配载网点',
  `ship_load_times` tinyint(2) DEFAULT '0' COMMENT '配载次数',
  `ship_storage` tinyint(2) DEFAULT '0' COMMENT '是否入库（0：已入库,1：配载提货在库，2：未入库）',
  `ship_examine_type` tinyint(2) DEFAULT NULL COMMENT '运单是否审核（0：未审核 ，1：已审核）',
  `ship_abnormal_type` tinyint(8) DEFAULT '0' COMMENT '是否有异动（0：无异动 ，1：有异动）',
  `ship_is_dispatch` bit(1) DEFAULT b'0' COMMENT '是否急件（0：否，1：是）',
  `remark` varchar(100) DEFAULT NULL COMMENT '运单备注',
  `create_time` datetime NOT NULL COMMENT '录入时间',
  `company_id` int(11) NOT NULL COMMENT '当前用户所在公司id',
  `network_id` int(11) NOT NULL COMMENT '网点id',
  `user_id` int(11) NOT NULL,
  `to_network_id` int(11) DEFAULT NULL COMMENT '到达网点(专线)',
  `ship_is_update` bit(1) DEFAULT b'0' COMMENT '运单是否改单- 0:否 1：是',
  PRIMARY KEY (`ship_id`)
) ENGINE=InnoDB AUTO_INCREMENT=267 DEFAULT CHARSET=utf8 COMMENT='运单';

