  `resource_id` int(11) DEFAULT NULL COMMENT '关联id',
  `resource_type` tinyint(2) DEFAULT NULL COMMENT '关联类型（1：运单id,2:配载单id,3:中转单id）',
  `fee_type` tinyint(3) DEFAULT NULL COMMENT '费用类型（1：现付、2：提付、3：回单付、4：月结、5：短欠、6：货款扣、7：提货费、8：送货费、9：短驳费、10：中转费、11：回扣、12：现付运输费、13：现付油卡费、14：回付运输费、15：整车保险费、16：发站装车费、17：发站其他费、18：到付运输费、19：到站卸车费、20：到站其他费、21：对账提付、22：异动减款、23：异动增加）',
  `fee` double(10,2) DEFAULT NULL COMMENT '费用',
  `fee_in_fill` bit(1) DEFAULT b'0' COMMENT '应收是否结算（0：否，1：已结算）',
  `fee_out_fill` bit(1) DEFAULT b'0' COMMENT '应付是否结算（0：否，1：已结算）',
