/*Table structure for table `kd_truck_load` */

DROP TABLE IF EXISTS `kd_truck_load`;

CREATE TABLE `kd_truck_load` (
  `load_id` int(11) NOT NULL AUTO_INCREMENT,
  `load_sn` varchar(32) DEFAULT NULL COMMENT '配载单号',
  `truck_id` int(11) NOT NULL,
  `load_fee` double(10,2) NOT NULL COMMENT '运费',
  `load_fee_fill` bit(1) DEFAULT b'0' COMMENT '是否结算',
  `load_atunload_fee` double(10,2) DEFAULT NULL COMMENT '到站卸载费',
