  `load_atother_fee` double(10,2) DEFAULT NULL COMMENT '到站其他费',
  `load_atother_fill` bit(1) DEFAULT b'0' COMMENT '到站其他费是否结算',
  `load_is_unload` bit(1) DEFAULT b'0' COMMENT '是否卸载（0：未卸载，1：已卸载）',
  `load_volume` double(10,3) DEFAULT NULL COMMENT '配载体积',
  `load_amount` smallint(8) DEFAULT NULL COMMENT '配载数量',
  `load_weight` double(10,2) DEFAULT NULL COMMENT '配载重量',
  `load_count` smallint(5) DEFAULT NULL COMMENT '运单件数',
  `load_fee_prepay` double(10,2) NOT NULL DEFAULT '0.00' COMMENT '运费预付',
  `load_fee_allocation_way` tinyint(2) DEFAULT NULL COMMENT '费用分摊方式 1-按单，2-按体积，3-按重量',
  `load_arrival_time` datetime DEFAULT NULL COMMENT '到达时间',
  `load_depart_time` datetime NOT NULL COMMENT '发车时间',
  `load_next_network_id` int(11) NOT NULL COMMENT '到货网点',
  `load_transport_type` tinyint(2) NOT NULL COMMENT '运输类型, 1 - 提货，2-短驳，3-干线，4-送货',
  `load_delivery_from` varchar(125) DEFAULT NULL COMMENT '出发地',
  `load_delivery_to` varchar(125) DEFAULT NULL COMMENT '到达地',
  `load_deleted` bit(1) DEFAULT b'0' COMMENT '是否删除（0：正常，1：删除）',
  `load_fee_status` bit(1) DEFAULT b'0' COMMENT '是否付款（0：未付款，1：已付款）',
  `load_pay_time` datetime DEFAULT NULL COMMENT '确认付款时间',
  `load_delivery_status` tinyint(2) DEFAULT NULL COMMENT '该配载运送状态：1-配载中，2-已发车，3：已到达，4：已完成',
  `load_finish_time` datetime DEFAULT NULL COMMENT '配载单完成时间',
