/*Table structure for table `library_image` */

DROP TABLE IF EXISTS `library_image`;

CREATE TABLE `library_image` (
  `uuid` varchar(22) NOT NULL COMMENT '图片地址',
  `gid` varchar(9) NOT NULL COMMENT '图片所在的组号，表示的是属于同一组，为9位Hash码指，hash码是根据当前的时间戳和随机种子产生的，因此在同一表里是全局唯一的。',
  `image` varchar(225) NOT NULL COMMENT '图片相对路径(去掉主机地址)：如，/ab/cd/ef.jpg',
  `tag` varchar(45) DEFAULT NULL COMMENT '图片标签',
  `host` varchar(25) NOT NULL COMMENT '图片所在的服务器',
  `order` tinyint(2) NOT NULL DEFAULT '0' COMMENT '图片显示顺序，数字越高排列越前，排序指的是同一组图片',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '图片状态，1 - 正常使用，0 - 已被删除或者缺失或被禁用',
  `create_time` int(11) NOT NULL COMMENT '图片添加时间',
  `user_id` int(11) NOT NULL,
  `size` int(11) DEFAULT NULL COMMENT '图片大小，单位byte(字节)\n',
  `width` varchar(45) DEFAULT NULL COMMENT '图片宽度',
  `height` varchar(45) DEFAULT NULL COMMENT '图片高度',
  `extension` varchar(45) DEFAULT NULL COMMENT '图片扩展名，如“jpg”，"png","git"',
  KEY `fk_library_image_1_idx` (`user_id`) USING BTREE,
  CONSTRAINT `library_image_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `sys_user` (`userid`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='平台所有图片地址集合';

/*Data for the table `library_image` */


