  `key_letter` char(1) NOT NULL COMMENT '首字母',
  `parent_code` varchar(6) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `regionCode_UNIQUE` (`region_code`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=6896 DEFAULT CHARSET=utf8 COMMENT='国家行政区域检索表，包括省、市、县（区）';

/*Data for the table `library_region` */


