/*Table structure for table `logistics_line` */

DROP TABLE IF EXISTS `logistics_line`;

CREATE TABLE `logistics_line` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `from_city_code` char(6) DEFAULT NULL COMMENT '专线始发地，只到城市，用六位代码表示',
  `from_region_code` char(6) DEFAULT NULL COMMENT '专线始发地，只到县（区），用六位代码表示',
  `to_city_code` char(6) DEFAULT NULL COMMENT '专线目的地，只到城市，用六位代码表示',
  `to_region_code` char(6) DEFAULT NULL COMMENT '专线目的地，只到县（区），用六位代码表示',
  `survive_time` tinyint(3) DEFAULT '0' COMMENT '专线发布的有效时间，单位`小时`, 指的是从专线发布时间开始计算，超过多少时间，该专线将无效。 默认：0 - 长期有效',
  `price_heavy` decimal(8,2) DEFAULT NULL COMMENT '重货价格:元/公斤',
  `price_small` decimal(8,2) DEFAULT NULL COMMENT '轻货价格:元/公斤',
  `starting_price` decimal(8,2) DEFAULT NULL COMMENT '最低收费',
  `frequency` tinyint(2) NOT NULL DEFAULT '1' COMMENT '发车频次：次/天。默认：1 （一天至少一次）\n',
  `logistics_park_id` int(11) NOT NULL COMMENT '在哪个物流园开的专线',
  `company_id` int(11) NOT NULL COMMENT '是哪个公司开的专线',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `is_sale` tinyint(1) DEFAULT '0' COMMENT '(0:正常，1：特价)',
  `is_live` tinyint(1) NOT NULL DEFAULT '1' COMMENT '专线有效性，1-有效专线（默认），0- 无效',
  `address` varchar(50) DEFAULT NULL COMMENT '详细位置',
  `network_id` int(11) NOT NULL COMMENT '网点id',
  `arrive_network_id` int(11) DEFAULT NULL COMMENT '到达网点id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=581 DEFAULT CHARSET=utf8 COMMENT='物流公司专线运输';

/*Data for the table `logistics_line` */


