/*Table structure for table `shipping_goods` */

DROP TABLE IF EXISTS `shipping_goods`;

CREATE TABLE `shipping_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `good_name` char(2) NOT NULL COMMENT '货物名称(选择)：kw -  矿物, 2-  （待续）',
  `amount` int(7) DEFAULT NULL COMMENT '货物数量，单位为‘件’',
  `weight` smallint(8) DEFAULT NULL COMMENT '货物重量\n',
  `weight_unit` char(1) DEFAULT NULL COMMENT '货物种类单位，k-公斤，t-吨',
  `volume` smallint(8) DEFAULT NULL COMMENT '货物体积/容量，单位为‘立方’',
  `charge_by` tinyint(2) NOT NULL COMMENT '货物运输计费标准,1-规则货物收费（按重量/体积收费）,2-不规则货物收费（按件计费）',
  `shipping_order_id` int(40) NOT NULL COMMENT '货物所在的发货单单号',
  `from_addr` int(30) DEFAULT NULL COMMENT '发货',
  `to_addr` int(30) DEFAULT NULL COMMENT '收货',
  PRIMARY KEY (`id`),
  KEY `fk_shipping_goods_1_idx` (`shipping_order_id`) USING BTREE,
  CONSTRAINT `shipping_goods_ibfk_1` FOREIGN KEY (`shipping_order_id`) REFERENCES `shipping_order` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='货物清单，发货单关于运输的货物详细描述';

/*Data for the table `shipping_goods` */

/*Table structure for table `shipping_order` */

DROP TABLE IF EXISTS `shipping_order`;

CREATE TABLE `shipping_order` (
  `id` int(70) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(50) NOT NULL COMMENT '运单号',
  `from_addr_uuid` varchar(50) NOT NULL COMMENT '发货地-引用地址薄',
  `to_addr_uuid` varchar(50) NOT NULL COMMENT '收货地-引用地址薄',
  `ship_distance` smallint(3) NOT NULL DEFAULT '0' COMMENT '运输里程-单位：公里',
  `sender` varchar(15) NOT NULL COMMENT '发货人',
  `sender_mobile` varchar(20) NOT NULL COMMENT '发货人手机号码',
  `receiver` varchar(15) DEFAULT NULL COMMENT '收货人',
  `receiver_mobile` varchar(11) NOT NULL COMMENT '收货人手机号码',
  `all_weight` smallint(8) DEFAULT NULL COMMENT '货物总重量-公斤',
  `all_volume` smallint(8) DEFAULT NULL COMMENT '货物总体积-方\n',
  `all_amount` smallint(8) DEFAULT NULL COMMENT '货物总件数-件',
  `price_heavy` decimal(8,2) DEFAULT NULL COMMENT '重货价格:元/公斤',
  `price_small` decimal(8,2) DEFAULT NULL COMMENT '轻货价格:元/公斤',
  `starting_price` char(20) DEFAULT NULL COMMENT '起步价',
  `truck_length` tinyint(40) DEFAULT NULL COMMENT '车辆长度要求',
  `truck_type` tinyint(40) DEFAULT NULL COMMENT '车辆类型要求',
  `truck_freight` int(11) DEFAULT NULL COMMENT '车辆运价',
  `trunk_remark` text COMMENT '车辆要求其他说明',
  `is_truckload` tinyint(50) NOT NULL DEFAULT '1' COMMENT '是否整车运输，0- 不是，1-是',
  `is_live_from` tinyint(1) NOT NULL DEFAULT '1' COMMENT '运单对发货方是否有效（或可见），0-无效，1-有效（默认）',
  `is_live_to` tinyint(1) NOT NULL DEFAULT '1' COMMENT '运单对收货方是否有效（或可见），0-无效，1-有效（默认）',
  `ship_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '运单状态（0：默认状态，1：交易进行中，2：交易确认，3：交易完成）',
  `create_time` varchar(50) NOT NULL COMMENT '运单添加时间',
  `update_time` varchar(50) DEFAULT NULL COMMENT '修改日期',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `line_user_id` int(11) DEFAULT NULL COMMENT '专线用户id',
  `line_id` int(11) NOT NULL COMMENT '专线id',
  `send_status` int(10) DEFAULT '0' COMMENT '常发状态:1是保存常发',
  PRIMARY KEY (`id`),
  KEY `fk_shipping_order_1_idx` (`user_id`) USING BTREE,
  CONSTRAINT `shipping_order_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `sys_user` (`userid`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='发货单，货源方给承运方下的货物运输合同';

/*Data for the table `shipping_order` */

/*Table structure for table `shop` */

DROP TABLE IF EXISTS `shop`;

CREATE TABLE `shop` (
  `id` int(11) NOT NULL COMMENT '店铺id，与user_id相同',
  `shop_name` varchar(125) DEFAULT NULL COMMENT '店铺显示名称',
  `shop_subdomain` varchar(15) DEFAULT NULL COMMENT '用于访问店铺的子域名',
  `shop_desc` text COMMENT '店铺描述',
  `shop_desc_short` varchar(450) DEFAULT NULL COMMENT '公司简介',
  `figure_img_gid` varchar(9) DEFAULT NULL COMMENT '公司网站形象照片-图片库图片组id',
  `scroll_img_gid` varchar(9) DEFAULT NULL COMMENT '首页宣传图片-图片库图片组id',
  `create_time` date NOT NULL COMMENT '店铺首次开通时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '店铺信息最后更新时间',
  `theme` varchar(64) DEFAULT NULL COMMENT '店铺主题',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `culture_desc` text COMMENT '公司品牌简述',
  `culture_img_gid` varchar(9) DEFAULT NULL COMMENT '品牌相关图片',
  `culture_jzg` text COMMENT '公司价值观',
  `culture_sm` text COMMENT '公司使命',
  `show_yyzz` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否显示公司营业执照，1-显示，0-不显示(默认)',
  `show_sfz` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否显示公司法人/责任人身份证，1-显示，0-不显示(默认)',
  `show_mobile` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否显示公司法人/负责人手机号码，1-显示(默认)，0-不显示',
  `show_network_mobile` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否显示公司网点负责人手机号码，1-显示(默认)，0-不显示',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`) USING BTREE,
  UNIQUE KEY `user_id_UNIQUE` (`user_id`) USING BTREE,
  KEY `fk_shop_2_idx` (`user_id`) USING BTREE,
  CONSTRAINT `shop_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `sys_user` (`userid`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺，指在平台开通店铺或者子站';

