  `username` varchar(15) DEFAULT NULL COMMENT '用户登陆用用户名',
  `realname` varchar(15) DEFAULT NULL COMMENT '用户显示用户名',
  `password` varchar(32) NOT NULL COMMENT '登陆密码',
  `mobile` char(11) NOT NULL COMMENT '用户手机号码',
  `telephone` char(15) DEFAULT NULL COMMENT '固话',
  `is_onshop` int(20) DEFAULT '0' COMMENT '是否开通在线店铺，0 - 没有（默认），1 - 开通',
  `is_transline` tinyint(1) DEFAULT '0' COMMENT '是否专线用户，0- 不是（默认），1-是',
  `usertype` tinyint(2) NOT NULL DEFAULT '1' COMMENT '类型//select/1 - 普通用户,2 - , 3 - 非物流公司, 4 -物流公司, 5 -个人(司机), 6 -车队',
  `create_time` datetime NOT NULL COMMENT '该用户添加时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '该用户信息最后更新时间',
  `end_time` datetime DEFAULT NULL,
  `email` varchar(64) DEFAULT NULL COMMENT '邮箱地址',
  `remark` varchar(1000) DEFAULT NULL COMMENT '备注',
  `create_id` int(11) NOT NULL DEFAULT '0' COMMENT '创建者id,0-表示公司第一个全局用户（相当于root用户）',
  `title_img_uuid` varchar(9) DEFAULT NULL COMMENT '头像',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '用户账户当前状态。0 - 删除，1 - 激活， 2 - 待激活，3 - 禁用',
  `is_locked` tinyint(1) DEFAULT '0' COMMENT '账户是否被锁定，0 - 未有，1 - 锁定',
  `depart_id` int(11) DEFAULT NULL COMMENT '部门id',
  `company_id` int(11) DEFAULT NULL COMMENT '公司id',
  PRIMARY KEY (`userid`),
  UNIQUE KEY `mobile_UNIQUE` (`mobile`) USING BTREE,
  UNIQUE KEY `username_UNIQUE` (`username`) USING BTREE,
  KEY `fk_sys_user_1_idx` (`depart_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8 COMMENT='用户表，记录平台所有登陆用户';

