/*Table structure for table `truck` */

DROP TABLE IF EXISTS `truck`;

CREATE TABLE `truck` (
  `truck_id` int(11) NOT NULL AUTO_INCREMENT,
  `truck_id_number` varchar(12) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `truck_type` tinyint(2) DEFAULT NULL COMMENT '车厢类型 1厢式货车 2面包车 3金杯车(高顶) 4金杯车(低顶) 5中巴货车 6高栏车 7低栏车 8平板车 9高低板车 10半挂车 11自卸车 12冷藏车 13保温车 14罐式车 15铁笼车 16集装箱运输车 17轿车运输车 18大件运输车 19起重车 20危险品车 21爬梯车 22中栏车 23全挂车 24加长挂车',
  `truck_length` double(3,1) DEFAULT NULL COMMENT '车厢长度(米)',
  `truck_hired_mode` tinyint(2) DEFAULT NULL COMMENT '租赁方式 1- 自由车辆，2-外包车辆，3-临时车辆',
  `truck_driver_name` varchar(15) NOT NULL COMMENT '司机姓名',
  `truck_driver_mobile` char(11) NOT NULL COMMENT '司机电话',
  `truck_driver_id_number` varchar(15) DEFAULT NULL COMMENT '司机证件号码',
  `truck_owner_name` varchar(15) DEFAULT NULL COMMENT '车主姓名',
  `truck_owner_mobile` char(11) DEFAULT NULL COMMENT '车主电话',
  `truck_owner_id_number` varchar(15) DEFAULT NULL COMMENT '车主证件号码',
  `truck_image_gid` char(9) DEFAULT NULL COMMENT '车辆（司机）证件照片',
  `truck_remark` varchar(525) DEFAULT NULL COMMENT '备注',
  `create_time` datetime NOT NULL COMMENT '录入时间',
  `company_id` int(11) NOT NULL COMMENT '当前用户所在公司id',
  PRIMARY KEY (`truck_id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='运输车/货车';

