/* Function  structure for function  `getBookUUIDRegion` */

/*!50003 DROP FUNCTION IF EXISTS `getBookUUIDRegion` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getBookUUIDRegion`(uuid      CHAR(30)) RETURNS varchar(22) CHARSET utf8
    COMMENT '获取地址薄中省/市/区code'
BEGIN
       DECLARE l_qu_code VARCHAR(6);
       DECLARE l_code_string VARCHAR(22);
    
       SELECT region_code INTO l_qu_code FROM anfawuliu.address_book where uuid=uuid LIMIT 1;
       
       SELECT CONCAT(p.region_code,"/",c.region_code,"/",q.region_code) INTO l_code_string FROM anfawuliu.library_region as q  
       left join library_region as c on c.region_code = q.parent_code 
       left join library_region as p on p.region_code = c.parent_code 
       where q.region_code=l_qu_code;
            
       RETURN(l_code_string);
    
    END */$$
DELIMITER ;

