/* Function  structure for function  `getLineRegion` */

/*!50003 DROP FUNCTION IF EXISTS `getLineRegion` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getLineRegion`(in_city_code      CHAR(6),
      in_county_code    CHAR(6)
     ) RETURNS varchar(255) CHARSET utf8
BEGIN
       DECLARE l_region_string VARCHAR(255);
       DECLARE v_finished INTEGER DEFAULT 0;
       
       DECLARE v_region_name VARCHAR(125) DEFAULT "";
       DECLARE v_city VARCHAR(125) DEFAULT "";
       DECLARE v_region_type TINYINT(2) DEFAULT 0;
      
       DECLARE v_code CHAR(6);
       SET v_code = IFNULL(NULLIF(in_county_code,''),in_city_code);
       SELECT region_name, city, region_type INTO  v_region_name, v_city, v_region_type FROM library_region WHERE region_code = v_code limit 1;
       
       IF v_region_type = 4 THEN
            SET l_region_string = CONCAT(v_city, " ", v_region_name);
	   ELSEIF v_region_type = 3  THEN
            SET l_region_string = v_region_name;
       END IF;       
       RETURN(l_region_string);    
     END */$$
DELIMITER ;

