/* Function  structure for function  `getRegion` */

/*!50003 DROP FUNCTION IF EXISTS `getRegion` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getRegion`(in_region_code      CHAR(6)) RETURNS varchar(255) CHARSET utf8
BEGIN
       DECLARE l_region_string VARCHAR(255);
       DECLARE v_finished INTEGER DEFAULT 0;
       
       DECLARE v_region_name VARCHAR(125) DEFAULT "";
       DECLARE v_city VARCHAR(125) DEFAULT "";
       DECLARE v_region_type TINYINT(2) DEFAULT 0;
        
       DEClARE region_cursor CURSOR FOR SELECT region_name, city, region_type   FROM library_region WHERE region_code = in_region_code limit 1;
       
       DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_finished = 1;       
       OPEN region_cursor; 
       get_region: LOOP  
         FETCH region_cursor INTO v_region_name,v_city,v_region_type;
 
         IF v_finished = 1 THEN 
            LEAVE get_region;
         END IF;
 
         IF v_region_type = 4 THEN
            SET l_region_string = CONCAT(v_city, " ", v_region_name);
         ELSE
            SET l_region_string = v_region_name;
         END IF;
         
         LEAVE get_region;
       END LOOP get_region;
 
       CLOSE region_cursor;
 
       RETURN(l_region_string);    
     END */$$
DELIMITER ;

