DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getScmVerifyStatus`(l_user_id     INT(11),
     l_flow_from  TINYINT(2)) RETURNS tinyint(2)
    COMMENT '获取需要审核业务流程的认证状态'
