/* Function  structure for function  `myFunction` */

/*!50003 DROP FUNCTION IF EXISTS `myFunction` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `myFunction`(in_string      VARCHAR(255),
      in_find_str    VARCHAR(20),
      in_repl_str    VARCHAR(20)) RETURNS varchar(255) CHARSET utf8
BEGIN
       DECLARE l_new_string VARCHAR(255);
       DECLARE l_find_pos   INT;
    
       SET l_find_pos=INSTR(in_string,in_find_str);
    
       IF (l_find_pos>0) THEN
         SET l_new_string=INSERT(in_string,l_find_pos,LENGTH(in_find_str),in_repl_str);
       ELSE
         SET l_new_string=in_string;
       END IF;
      RETURN(l_new_string);
    
     END */$$
DELIMITER ;

/* Procedure structure for procedure `reset_database` */

/*!50003 DROP PROCEDURE IF EXISTS  `reset_database` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `reset_database`(DB_NAME VARCHAR(100))
BEGIN
DECLARE done INT DEFAULT FALSE;
DECLARE tableName VARCHAR(100);
DECLARE cur CURSOR FOR SELECT table_name FROM INFORMATION_SCHEMA.tables WHERE table_schema = DB_NAME AND table_type = 'BASE TABLE';
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

OPEN cur;

SET FOREIGN_KEY_CHECKS = 0;
read_loop: LOOP
FETCH cur INTO tableName;
  IF done THEN LEAVE read_loop; END IF;
  SET @s = CONCAT('truncate table ',tableName);
  PREPARE stmt1 FROM @s;
  EXECUTE stmt1;
  DEALLOCATE PREPARE stmt1;
END LOOP;
SET FOREIGN_KEY_CHECKS = 1;

CLOSE cur;
END */$$
DELIMITER ;

